    let id = this.safeString2(trade, 't', 'a');
    id = this.safeString2(trade, 'tradeId', 'id', id);
    let side = undefined;
    const orderId = this.safeString(trade, 'orderId');
    const buyerMaker = this.safeValue2(trade, 'm', 'isBuyerMaker');
