      'info': trade,
      'timestamp': timestamp,
      'datetime': this.iso8601(timestamp),
      'symbol': symbol,
      'id': id,
      'order': orderId,
      'type': this.safeStringLower(trade, 'type'),
      'side': side,
      'takerOrMaker': takerOrMaker,
      'price': price,
      'amount': amount,
      'cost': cost,
      'fee': fee
