        const toFuture = toId === 'UMFUTURE' || toId === 'CMFUTURE';
        const fromSpot = fromId === 'MAIN';
        const toSpot = toId === 'MAIN';
        const funding = fromId === 'FUNDING' || toId === 'FUNDING';
        const mining = fromId === 'MINING' || toId === 'MINING';
