  parseTrade(trade, market = undefined) {
    //
    // public fetchTrades
    //
    //     {
    //         "instId": "ETH-BTC",
    //         "side": "sell",
    //         "sz": "0.119501",
    //         "px": "0.07065",
    //         "tradeId": "15826757",
    //         "ts": "1621446178316"
    //     }
    //
    // private fetchMyTrades
    //
    //     {
    //         "side": "buy",
    //         "fillSz": "0.007533",
    //         "fillPx": "2654.98",
    //         "fee": "-0.000007533",
    //         "ordId": "317321390244397056",
    //         "instType": "SPOT",
    //         "instId": "ETH-USDT",
    //         "clOrdId": "",
    //         "posSide": "net",
    //         "billId": "317321390265368576",
    //         "tag": "0",
    //         "execType": "T",
    //         "tradeId": "107601752",
    //         "feeCcy": "ETH",
    //         "ts": "1621927314985"
    //     }
    //
    const id = this.safeString(trade, 'tradeId');
    const marketId = this.safeString(trade, 'instId');
    market = this.safeMarket(marketId, market, '-');
    const symbol = market['symbol'];
    const timestamp = this.safeInteger(trade, 'ts');
    const price = this.safeString2(trade, 'fillPx', 'price');
    const amount = this.safeString2(trade, 'fillSz', 'size');
    const side = this.safeString(trade, 'side');
    const orderId = this.safeString(trade, 'ordId');
    const feeCostString = this.safeString(trade, 'fee');
    let fee = undefined;
    if (feeCostString !== undefined) {
      const feeCostSigned = _Precise.Precise.stringNeg(feeCostString);
      const feeCurrencyId = this.safeString(trade, 'feeCurrency');
      let feeCurrencyCode = this.safeCurrencyCode(feeCurrencyId);
      if (feeCurrencyCode === undefined) {
        feeCurrencyCode = 'USDT';
      }
      fee = {
        'cost': feeCostSigned,
        'currency': feeCurrencyCode
      };
    }
    let takerOrMaker = this.safeString(trade, 'execType');
    if (takerOrMaker === 'T') {
      takerOrMaker = 'taker';
    } else if (takerOrMaker === 'M') {
      takerOrMaker = 'maker';
    }
    return this.safeTrade({
      'info': this.deepExtend(trade, {
        'symbol': marketId
      }),
      'timestamp': timestamp,
      'datetime': this.iso8601(timestamp),
      'symbol': symbol,
      'id': id,
      'order': orderId,
      'type': undefined,
      'takerOrMaker': takerOrMaker,
      'side': side,
      'price': price,
      'amount': amount,
      'cost': undefined,
      'fee': fee
    }, market);
  }
