      'timestamp': timestamp,
      'datetime': this.iso8601(timestamp),
      'symbol': symbol,
      'id': id,
      'order': orderId,
      'type': undefined,
      'takerOrMaker': takerOrMaker,
      'side': side,
      'price': price,
      'amount': amount,
      'cost': undefined,
      'fee': fee
