    //         "s": "BTCUSDT",
    //         "S": "Buy",
    //         "v": "0.001",
    //         "p": "16578.50",
    //         "L": "PlusTick",
    //         "i": "20f43950-d8dd-5b31-9112-a178eb6023af",
    //         "BT": false
    //     }
    //
    // spot private
    //     {
    //         "e": "ticketInfo",
    //         "E": "1662348310386",
    //         "s": "BTCUSDT",
    //         "q": "0.001007",
    //         "t": "1662348310373",
    //         "p": "19842.02",
    //         "T": "2100000000002220938",
    //         "o": "1238261807653647872",
    //         "c": "spotx008",
