    //             fullname: "Tether",
    //             decimals: 18,
    //             balance_token: "USDT",
    //             created_time: "0",
    //             updated_time: "0"
    //         },
    //         {
    //             token: "ZEC",
    //             fullname: "ZCash",
    //             decimals: 8,
    //             balance_token: "ZEC",
    //             created_time: "0",
    //             updated_time: "0"
    //         },
    //         ...
    //     ],
    //     success: true
    // }
    //
    // only make one request for currrencies...
    // const tokenNetworkResponse = await this.v1PublicGetTokenNetwork (params);
    //
    // {
    //     rows: [
    //         {
    //             protocol: "ERC20",
    //             token: "USDT",
    //             name: "Ethereum",
    //             minimum_withdrawal: 30,
    //             withdrawal_fee: 25,
    //             allow_deposit: 1,
