    //             protocol: "TRC20",
    //             token: "USDT",
    //             name: "Tron",
    //             minimum_withdrawal: 30,
    //             withdrawal_fee: 1,
    //             allow_deposit: 1,
    //             allow_withdraw: 1
    //         },
    //         ...
    //     ],
    //     success: true
    // }
    //
    const tokenRows = this.safeValue(tokenResponse, 'rows', []);
    const networksByCurrencyId = this.groupBy(tokenRows, 'balance_token');
